  obtenerGuias(): void {
    this.paramServiceGE.obtenerListaPadres('COMBO_GENERAR_GUIA').subscribe((info) => {
      if (this.notaPedido.value.metodoPago.includes('Contra-Entrega')) {
        this.guias = info.filter((item) => item.valor === 'Motorizado');
      } else {
        this.guias = info;
      }
    });
  }

  obtenerTransacciones(): void {
    this.pedidosService.obtenerListaPedidos({
      page: this.page - 1,
      page_size: this.pageSize,
      inicio: this.inicio,
      fin: this.transformarFecha(this.fin),
      estado: ['Autorizado']
    }).subscribe((info) => {
      this.collectionSize = info.cont;
      this.listaTransacciones = info.info;
    });
  }

  transformarFecha(fecha): string {
    return this.datePipe.transform(fecha, 'yyyy-MM-dd');
  }

  obtenerTransaccion(id): void {
    this.pedidosService.obtenerPedido(id).subscribe((info) => {

      this.iniciarNotaPedido();
      this.horaPedido = this.extraerHora(info.created_at);
      info.articulos.map((item): void => {
        this.agregarItem();
      });
      this.notaPedido.patchValue({...info, canal: this.cortarUrlHastaCom(info.canal)});
      this.calcular();
    });
  }

  generarGuia(modal, id): void {
    this.pedidosService.obtenerPedido(id).subscribe((info) => {
      this.iniciarNotaPedido();
      info.articulos.map((item): void => {
        this.agregarItem();
      });
      this.notaPedido.patchValue({...info});

      if (this.notaPedido.value.metodoPago === 'Previo Pago Servientrega Nacional') {
        this.mostrarDiv = true;
        this.mostrarImprimirGuia = false;
        this.notaPedido.get('guiServiEntrega').setValidators([Validators.required]);
        this.notaPedido.get('guiServiEntrega').updateValueAndValidity();
        this.obtenerTransacciones();
      }
      //this.obtenerGuias();
      this.modalService.open(modal, {size: 'xl'});
    });
  }


