  onSelectChange(event: any) {
    const selectedValue = event.target.value;
    if (selectedValue.includes('Servientrega')) {
      this.mostrarImprimirGuia = false;
      this.mostrarDiv = true;
      this.notaPedido.get('guiServiEntrega').setValidators([Validators.required]);
      this.notaPedido.get('guiServiEntrega').updateValueAndValidity();

    } else {
      this.mostrarImprimirGuia = true;
      this.mostrarDiv = false;
      this.notaPedido.get('guiServiEntrega').setValidators([]);
      this.notaPedido.get('guiServiEntrega').updateValueAndValidity();
    }
  }

  onFileSelected(event: any) {
    this.fileToUpload = event.target.files.item(0);
    this.notaPedido.get('guiServiEntrega').setValue(this.fileToUpload.name);
  }

  guardarGuiaServiEntrega() {
    if (!this.fileToUpload) {
      return alert('Cargue el comprobante del mtodo de envo');
    }

    if (this.archivo) {
      const formData = new FormData();
      formData.append('guiServiEntrega', this.fileToUpload, this.fileToUpload.name);
      formData.append('id', this.notaPedido.value.id);
      formData.append('metodoPago', this.notaPedido.value.metodoPago);
      formData.append('verificarGeneracionGuia', '1');
      this.pedidosService.actualizarPedidoFormData(formData)
        .subscribe(() => {
          window.alert('Archivo guardado.');
          this.obtenerTransacciones();
          this.modalService.dismissAll();
        });

    } else {
      console.error('No se ha seleccionado ningn archivo.');
    }

  }


